function Header() {
  return (
    <header>
      <h1>(React) Google Books Search</h1>
      <p>Search for and Save Books of Interest</p>
      <blockquote>
        <p>
          "I know nothing with any certainty, but the sight of the stars makes
          m dream."
        </p>
        <footer>-- Vincent Van Gogh </footer>
      </blockquote>
    </header>
  );
}

export default Header;
